import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Params } from '@angular/router';
import { Observable } from 'rxjs';
import { Cabtype } from 'src/app/classes/cabtype';
import { BookService } from 'src/app/services/book.service';
import { Booking } from '../book/book.component';

@Component({
  selector: 'app-fare',
  templateUrl: './fare.component.html',
  styleUrls: ['./fare.component.css']
})
export class FareComponent implements OnInit{

  public Id!: number;
  public fare: number | undefined ;
  public bookings: Observable<Booking> = new Observable();
  constructor(private route: ActivatedRoute,
    public bookService: BookService) {}

    compareByCabId(cab1: Cabtype, cab2: Cabtype) {
      return cab1 && cab2 && cab1.cabTypeId === cab2.cabTypeId;
    }

    onSelectOption(category: Cabtype | Event | undefined) {
      // this.productForm.patchValue({
      //   category: this.categories.find(x => x.categoryId === category.categoryId)
      // })
    }
  ngOnInit(): void {
    this.route.params.subscribe((params: Params) => this.Id = params['id']);
    console.log(this.Id);
    this.bookService.getBookingById(this.Id).subscribe(data => {
      console.log(data); // should be your users.
      this.fare = data.bookingFare;
    }, error => {
        console.log(error); // if api returns and error you will get it here  
    }); 
  }

  deleteBooking(bookingId: number){
    this.bookService.deleteProduct(bookingId);
  }




}
<div id="booking" class="section">

    <div class="section-center">
        <div class="container">
            <div class="row">
                <div class="booking-form">
                    <div class="form-header">
                        <h1>Book Your Cab</h1>
                    </div>
                    <form >
                        <div class="form-group">
                            <p class="label" >                              
                                    The Fare of your cab will be {{ fare }}  
                            </p>

                        </div>
                        <div class="form-btn">
                            <a routerLink="/home"><button class="submit-btn">Ok</button></a>
                            <a routerLink="/home"><button (click)="deleteBooking(Id)" class="submit-btn float">Cancel </button></a>
                        </div>

                    </form>
                </div>
            </div>
        </div>
    </div>
</div>
